import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="grid">
       <header>
            <h1>FutureTube</h1>
            <input type="text" name="busca" value="Busca">
            </input>
        </header>
    </div>
  );
}

export default App;
